import TypingCustom from '../components/TypingCustom'

const Index = () => (
    <header className='header'>
        hello
    <style jsx>{`
        .header {
            font-family: 'Arial';
            background-color: #A8D3F8;
            width: 100%;
            height: 80px;
            display: block;
        }
        body {
            padding:0; 
            margin:0; 
            background-color:green;
            border-width:0px; 
        }

      `}</style>
    </header>

);

export default Index;
